The Authority has secured funding for the following project:
      o Pitched and Flat Roofing Replacement Works at Cold Harbour CofE Primary School 
      
      The Project Objectives are to ensure that: 
      
      o The project is to ensure minimal disruption of the school's operations during works and be collaborative with the school;
      o The flat roof covering systems are to meet the fire classification of BS EN 13501-5 Broof(T4);
      o The pitched roof covering systems are to meet the British Standard for Slating and Tiling (BS 5534);
      o Works are to enhance the School Building by upgrading poor condition elements;
      o Works are to improve the energy efficiency of the School Building in accordance with Building Regulations Part L;
      o Rainwater goods are safe and easy to clean and maintain;
      o Roof coverings installed are to be those specified or equal and approved;
      o Works are carried out in compliance with CDM Regulations 2015, to ensure the health and safety of contractors, workers and end users of the property; and
      o Works are completed on time, within budget and to a high quality in order to obtain the associated guarantees.

Colchester Borough Council currently has 6000 properties within its housing stock which are managed on their behalf by Colchester Borough Homes.
      
      The successful tenderer will be expected to undertake Void Property Works comprising the following:
      
      Revenue Void Works is any or all standard Works Ordered to a Void Property in accordance with the Employer's minimum lettable standard (Void Minimum Standard Preamble);
      
      Capital Void Works is any other non-standard Works Ordered to a Void Property that is outside of the Employer's minimum lettable standard (Void Minimum Standard Preamble) or, in respect of an acquisition requiring a mini refurbishment to bring it back to decent homes standard, which includes but is not limited to:
      - Kitchens;
      - Bathrooms/WCs;
      - Electrical installations;
      - Heating installations;
      - Replacement windows;
      - Replacement dwelling entrance doors; 
      - Disabled aids and adaptations;
      - Internal and external insulations;
      - Roofs (flat, pitched, system);
      - Fascia/cladding and rainwater goods;
      - Redecoration and pre-decorations repairs;
      - Other associated works to achieve 'Decent Homes' and 'Secure by Design' standards; and
      - Co-ordination of asbestos removal and encapsulation with the Employer's appointed asbestos consultant(s) and other asbestos removal contractor(s);
      - Co-ordination of capping off gas supplies and undertaking gas safety checks with the Employer's appointed gas servicing contractor(s);
      
      Emergency Works directly relating to the undertaking of the Works by the Contractor.
      
      Insurance Works comprising any necessary Works required and Ordered following storm, fire, flood, impact, subsidence damage or damage arising from the effect of any other like peril.
      
      The Council is intending to enter into a 2-year contract with the possibility of 2 x 1 year extension's using the JCT Measure Term Contract 2016 Edition. 
      
      TUPE will apply and details will be provided.

Additional information: The contracting authority considers that this contract may be suitable for economic operators that are small or medium enterprises (SMEs). However, any selection of tenderers will be based solely on the criteria set out for the procurement.
